from collections import Counter

def specialTriplets(nums: list[int]) -> int:
    MOD = 10**9 + 7
    right_map = Counter(nums)
    left_map = Counter()
    count = 0

    for num in nums:
        right_map[num] -= 1

        target = num * 2

        if left_map[target] > 0 and right_map[target] > 0:
            count = (count + left_map[target] * right_map[target]) % MOD

        left_map[num] += 1

    return count

